import ImageUtil_BMP from "./ImageUtil._bmp";
import {ImageFormat} from "../objs/projects";
import ndarray from "ndarray";
import FileUtil from "./FileUtil";

describe("BMP image helper", () => {

    test("Handles empty DataURL", () => {
        const imageDataURL = 'data:image/bmp;base64,';
        const img = new ImageUtil_BMP(ImageFormat.BMP, imageDataURL);
        const imageItem = img.buildImageItem(
            FileUtil.getFileParts('./sprites/hero/happy.bmp') ?? FileUtil.EMPTY_FILEPARTS,
            FileUtil.getFileBytes(imageDataURL, 'data:image/bmp;base64,') ?? ndarray([]),
        );

        expect(imageItem?.isEmpty).toEqual(true);
    });

    test("Handles malformed DataURL", () => {
        const imageDataURL = 'daft;';
        const img = new ImageUtil_BMP(ImageFormat.BMP, imageDataURL);
        const imageItem = img.buildImageItem(
            FileUtil.getFileParts('./sprites/hero/happy.bmp') ?? FileUtil.EMPTY_FILEPARTS,
            FileUtil.getFileBytes(imageDataURL, 'data:image/bmp;base64,') ?? ndarray([]),
        );

        expect(imageItem?.isEmpty).toEqual(true);
    });

    test("Reads from DataURL", () => {
        // LogUtil.OutputModule = console;
        const imageDataURL = 'data:image/bmp;base64,';
        const img = new ImageUtil_BMP(ImageFormat.BMP, imageDataURL);
        const imageItem = img.buildImageItem(
            FileUtil.getFileParts('./sprites/hero/happy.bmp') ?? FileUtil.EMPTY_FILEPARTS,
            FileUtil.getFileBytes(imageDataURL, 'data:image/bmp;base64,') ?? ndarray([]),
        );

        expect(imageItem?.frames?.length).toEqual(1);
        expect(imageItem?.frames?.flat()[0].width).toEqual(150);
        expect(imageItem?.frames?.flat()[0].height).toEqual(240);
        expect(imageItem?.frames?.flat()[0].data?.length).toEqual(150 * 240 * 4);
    });

});
